insert into book (names, author, publications, resume, available, category, editorial, languages) values ('Cien años de soledad', 'Gabriel Garcia Marquez', '1967','Inspirado por un sueño durante su travesía en la selva, José Arcadio Buendía decide quedarse en ese punto del camino y fundar Macondo, pueblo que crece poco a poco. El pueblo recibe con frecuencia las visitas de los gitanos. Su líder, Melquíades, trae siempre artefactos y objetos que obsesionan a José Arcadio Buendía.', true, 'Novela', 'Sudamericana', 'ES-EN');
